'use strict';
let DXFeedConnection = require('./DXFeedConnection.js');
let DXFeedMessageFactory = require('./DXFeedMessageFactory.js');
class DXFeedConnectionFactory {
    socketCommunicatorFactory;
    static create(socketCommunicatorFactory) {
        let result;
        result = new DXFeedConnectionFactory();
        result.socketCommunicatorFactory = socketCommunicatorFactory;
        return result;
    }
    createConnection() {
        return DXFeedConnection.create(this.socketCommunicatorFactory.createSocketCommunicator(), new DXFeedMessageFactory());
    }
}
module.exports = DXFeedConnectionFactory
